import { BrowserRouter,} from 'react-router-dom';
import './App.css';
import { Footer } from './footer/footer';
import { Header } from './header/header';
import { Main } from './main page/main';
import { Portfolio } from './portfolio/portfolio';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
          <Header/>
          <Route path='/main/'>
            <Main/>
          </Route>
            <Route path='/portfolio/'>
            <Portfolio/>
          </Route>
          <Footer/>
      </BrowserRouter>
    </div>
  );
}

export default App;
